import React, { useState, useEffect } from 'react';
import './createEventsForm.css';
import { Row, Col, Form, Button, Table } from 'react-bootstrap';
import axios from 'axios';

const CreateEventsForm = () => {
  const [eventName, setEventName] = useState('');
  const [eventDate, setEventDate] = useState('');
  const [estimatedBudget, setEstimatedBudget] = useState('');
  const [description, setDescription] = useState('');
  const [eventsData, setEventsData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:3001/events');
      setEventsData(response.data);
    } catch (error) {
      console.log('Error fetching events data:', error);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const data = {
      eventName,
      eventDate,
      estimatedBudget,
      description
    };

    axios
      .post('http://localhost:3001/events', data)
      .then((response) => {
        console.log('Event created successfully:', response.data);
        setEventName('');
        setEventDate('');
        setEstimatedBudget('');
        setDescription('');
        fetchData();
      })
      .catch((error) => {
        console.log('Error creating event:', error);
      });
  };

  return (
    <div>
      <h1 className="Events_CreateEvents_heading1">Create Your Event</h1>
      <div className="CreateEvents_form_full" style={{ overflowX: 'hidden' }}>
        <Form onSubmit={handleSubmit}>
          <Row>
            <Col>
              <Form.Group controlId="eventName">
                <Form.Label>Event Name:</Form.Label>
                <Form.Control
                  type="text"
                  value={eventName}
                  onChange={(e) => setEventName(e.target.value)}
                  required
                />
              </Form.Group>
            </Col>
          </Row>
          <Row>
            <Col>
              <Form.Group controlId="eventDate">
                <Form.Label>Event Date:</Form.Label>
                <Form.Control
                  type="date"
                  value={eventDate}
                  onChange={(e) => setEventDate(e.target.value)}
                  required
                />
              </Form.Group>
            </Col>
          </Row>
          <Row>
            <Col>
              <Form.Group controlId="estimatedBudget">
                <Form.Label>Estimated Budget (Rs.):</Form.Label>
                <Form.Control
                  type="text"
                  value={estimatedBudget}
                  onChange={(e) => setEstimatedBudget(e.target.value)}
                />
              </Form.Group>
            </Col>
          </Row>
          <Row>
            <Col>
              <Form.Group controlId="description">
                <Form.Label>Description:</Form.Label>
                <Form.Control
                  as="textarea"
                  rows={3}
                  value={description}
                  onChange={(e) => setDescription(e.target.value)}
                />
              </Form.Group>
            </Col>
          </Row>
          <Button variant="primary" type="submit">
            Create Event
          </Button>
        </Form>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>Event Name</th>
              <th>Event Date</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {eventsData.map((event) => (
              <tr key={event.id}>
                <td>{event.eventName}</td>
                <td>{event.eventDate}</td>
                <td>
                  <Button variant="primary">View</Button>
                </td>
              </tr>
            ))}
          </tbody>
        </Table>
      </div>
    </div>
  );
};

export default CreateEventsForm;
